<?php

declare(strict_types=1);

namespace App\Email;

use App\Entity\Registration;
use App\Repository\QuestionRepository;
use App\Service\PriceFormatter;
use App\Service\UploadedFileUrlGenerator;
use Symfony\Bridge\Twig\Mime\TemplatedEmail;
use Symfony\Component\Mailer\MailerInterface;
use Symfony\Component\Mime\Address;
use Symfony\Component\Routing\Generator\UrlGeneratorInterface;
use Symfony\Contracts\Translation\TranslatorInterface;

/**
 * Mail template have been created thanks to https://usewaypoint.github.io/email-builder-js.
 *
 * @see https://usewaypoint.github.io/email-builder-js/#
 */
final readonly class RegistrationConfirmationSender
{
    public function __construct(
        private MailerInterface $mailer,
        private UrlGeneratorInterface $urlGenerator,
        private UploadedFileUrlGenerator $uploadedFileUrlGenerator,
        private PriceFormatter $priceFormatter,
        private TranslatorInterface $translator,
        private QuestionRepository $questionRepository,
    ) {
    }

    public function send(Registration $registration): void
    {
        if (!$registration->isConfirmed()) {
            throw new \RuntimeException('Cannot send a confirmation email for a registration which is not confirmed!');
        }

        $user = $registration->getUser();
        $event = $registration->getEvent();

        if (null === $faqCancellation = $this->questionRepository->findOneBySlug('est-ce-que-je-peux-annuler-ma-participation')) {
            throw new \RuntimeException('Question "est-ce-que-je-peux-annuler-ma-participation" is not found.');
        }

        $dateFormatter = new \IntlDateFormatter('fr_FR', dateType: \IntlDateFormatter::LONG, timeType: \IntlDateFormatter::NONE);

        $email = (new TemplatedEmail())
            ->from(new Address('contact@altercampagne.net', 'Altercampagne'))
            ->to(new Address($user->getEmail(), $user->getFullName()))
            ->subject('Ton inscription est valide ! ')
            ->htmlTemplate('emails/registration_confirmation.html.twig')
            ->context([
                'member' => [
                    'displayName' => $user->getPublicName(),
                ],
                'event' => [
                    'name' => $event->getName(),
                    /* @phpstan-ignore argument.type */
                    'startDate' => $dateFormatter->format($event->getFirstStage()?->getDate()),
                    /* @phpstan-ignore argument.type */
                    'endDate' => $dateFormatter->format($event->getLastStage()?->getDate()),
                    'imageUrl' => $this->uploadedFileUrlGenerator->getImageUrl($event->getPicture(), 150, 150),
                ],
                'registration' => [
                    'url' => $this->urlGenerator->generate('profile_registrations', [], UrlGeneratorInterface::ABSOLUTE_URL),
                    'price' => $this->priceFormatter->format($registration->getPrice()),
                    'cancelationDate' => $dateFormatter->format($registration->getCancelationDate()),
                ],
                'arrival' => [
                    /* @phpstan-ignore argument.type */
                    'date' => $dateFormatter->format($registration->getStartAt()),
                    'firstMeal' => $registration->getFirstMeal()->trans($this->translator),
                ],
                'departure' => [
                    /* @phpstan-ignore argument.type */
                    'date' => $dateFormatter->format($registration->getEndAt()),
                    'lastMeal' => $registration->getLastMeal()->trans($this->translator),
                ],
                'faq' => [
                    'cancellation' => $faqCancellation->getAnswer(),
                ],
            ])
        ;

        $this->mailer->send($email);
    }
}
